import React from "react";
import { Link } from "react-router-dom";
import {Button} from "@material-ui/core";
import Sidebar from "./Sidebar";

const Home = () => {
     const user = "";

  return !user?(
    <div className="home">
      <div className="home_body shadow">
         <Sidebar/>
      </div>
    </div>
  ):
  (
      <div className="home">
          <div className="login_body shadow">
              <Button>
                  Sign in
              </Button>
          </div>
      </div>
  );
};

export default Home;
